import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import HomePage from "./HomePage";
import HeaderNav from "./HeaderNav";
import DropdownMenu from './DropdownMenu';
import MyBets from "./MyBets";
import ActiveBets from "./ActiveBets";
import PageLayout from "./PageLayout";
import Shortlists from "./Shortlists";
import ExpiredBets from "./ExpiredBets";
import Leaderboard from "./Leaderboard";
import AdminPanel from "./AdminPanel";
import PlacementData from "./PlacementData";

export default function App() {
  return (
    <BrowserRouter>
      {/* <HeaderNav /> Removed to prevent duplicate header */}
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/home" element={<HomePage />} />
        <Route path="/my-bets" element={<MyBets />} />
        <Route path="/active-bets" element={<ActiveBets />} />
        <Route path="/shortlists" element={<Shortlists />} />
        <Route path="/expired-bets" element={<ExpiredBets />} />
        <Route path="/leaderboard" element={<Leaderboard />} />
        <Route path="/admin-panel" element={<AdminPanel />} />
        <Route path="/placement-data" element={<PlacementData />} />
      </Routes>
    </BrowserRouter>
  );
}
